import ReactPlayer from "react-player";
import styled from "styled-components";
import YouTubeEmbed from "../YouTubeEmbed";


const Home = () => {
    
    

    return (


            <SectionOne>

                <VideoBoxLine>
                TEAMFIGHT TACTICS
    <ReactPlayer
      url="https://www.youtube.com/embed/4HPfUrO5fBY&t=1s?showinfo=0&enablejsapi=1&origin=http://localhost:3000"
      playing={true}
      width="500px"
      height="300px"
      volume={0.3}
      loop={true}
    
      style={{pointerEvents: 'none', borderRadius:'20%', position: 'absolute'}}
    />
    </VideoBoxLine>


            </SectionOne>

        
    );
}

export default Home;

export const SectionOne = styled.div`
    background: linear-gradient(to right bottom, #fedd49, #fe5e49);
    height: 2000px;
    display: flex;
    justify-content: center;

`;

export const VideoBoxLine = styled.div`
    background: none;
    margin-top:200px;
    height: 400px;
    border: 4px solid white;
    display: flex;
    align-items: center;
    justify-content: center;
    z-index: -1;


`;




